import React from "react";
import "./App.css";
import Box1 from "./components/Box1";
import styled from "styled-components";
function App() {
  Box1 = styled.div`
    position: relative;
    background: green;
    height: 500px;
    width: 500px;
  `;
  return (
    <div>
      <Box1 />
    </div>
  );
}

export default App;
